    const currentStep = interstitialDetailsSignal.get().currentStep;
    const stepDetails = interstitialDetailsSignal.get().stepDetails;
    return html` <div
      aria-live="polite"
      aria-atomic="true"
      class="${carbonPrefix}--visually-hidden"
    >
      Step ${currentStep + 1} of ${stepDetails.length}
    </div>`;
